import {useState} from 'react'
import {Link} from 'react-router-dom';

const AddMovieComp = (props) =>
{
const [movie, setMovie] = useState({})


return(
<div style={{width:"300px", borderWidth : "3px", borderStyle : "solid", borderColor : "black"}}>
        
      Name : <input name="Name" onChange={e => setMovie({...movie, Name : e.target.value})} /> <br/>
      Genres : <input name="Genres" onChange={e => setMovie({...movie, Genres : e.target.value})} /><br/>
      Image URL : <input name="Image" onChange={e => setMovie({...movie, Image : e.target.value})} /><br/>
      Premierd : <input type="Date" name="Premierd" onChange={e => setMovie({...movie, Premierd : e.target.value})} /><br/>

      <input type="submit" value="Save"/>
      <Link to="/">Cancel</Link>


</div>)
}



export default AddMovieComp;
